          <ProductDiv />
          <ProductDiv />
          <ProductDiv />
          <ProductDiv />
          
        </StyledDiv>
      </MainDiv>
      <NextPage>
        <NextPageIcons>
          <button>1</button>
        </NextPageIcons>
        <NextPageIcons>
          <button>2</button>
        </NextPageIcons>
        <NextPageIcons>
          <button>3</button>
        </NextPageIcons>
        <NextPageIcons>
          <h1>...</h1>
        </NextPageIcons>
        <NextPageIcons>
          <button>5</button>
        </NextPageIcons>
      </NextPage>
    </div>
  );
}

export default Products;
